// Instanciando as fontes de particulas disponiveis na memoria
SistemaParticula sistema[nSistemaParticulas];

// Criando uma lista com as particulas existentes
Particula particula[nParticulas];

void instanciaParticula(struct Particula *particula, float xSistPart,float ySistPart,float zSistPart){
    /*
    A funcao instanciaParticula e responsavel pela criacao de uma nova particula.
    A funcao cria uma nova particula e define as caracteristicas basicas desta, como
    a cor da particula, o tempo de vida maximo que ela pode ter e um diametro de uma
    esfera de movimentacao, ao executar a funcao determina para a particula sua posicao
    inicial, seguindo o padrao da fonte, mas define o tempo vivido e sua velocidade seguindo
    uma relacao randomica, para dar a cada particula um movimento independente e diferente
    das outras e define o tamanho da particula.
    */

    glPushMatrix();

    // Raio da geracao da esfera randomica
    int diamRandEsf = 3;

    // Tempo de vida maximo para uma particula
    int tempoVividoMax = 2;

    // Define a cor da particula
    particula->cor[0] = 1.0f; // R
    particula->cor[1] = 0.0f; // G
    particula->cor[2] = 0.0f; // B
    particula->cor[3] = 1.0f; // Alfa

    // Define posio inicial particula
    particula->pos[0] = xSistPart;
    particula->pos[1] = ySistPart;
    particula->pos[2] = zSistPart;

    // Definio da velocidade randomica da particula (Randomico em x,y e z)

    // Rand retorna valores inteiros, entao o mesmo e normalizado e deixado tambem sua parte negativa
    particula->velocidade[0] = ((rand() % diamRandEsf) / (diamRandEsf * 1.0f)) - (1/ 2.0f);
    particula->velocidade[1] = ((rand() % diamRandEsf) / (diamRandEsf * 1.0f)) - (1 / 2.0f);
    particula->velocidade[2] = (((rand() % diamRandEsf) / (diamRandEsf * 1.0f)) - (1/ 2.0f)) + 0.5f;

    // Definindo posio inicial da particula
    glTranslatef(particula->pos[0],particula->pos[1],particula->pos[2]);

    // Definindo o sentido de movimentacao da particula pelo seu angulo
    particula->angulo_sentido = 30.0f;

    // Acrescenta um tempo de vida para a particula
    //particula->tempoDeVida = 0.5f;
    //particula->tempoVivido = 0.5f;

    // Faz o tempo de vida randomico para cada particula para dar um efeito independente
    particula->tempoVivido = ((rand() % tempoVividoMax)) / (tempoVividoMax * 1.0f) ;
    // Tempo de vida e o total sem o decaimento do tempo ja vivivdo
    particula->tempoDeVida = particula->tempoVivido;

    // Reduzindo o tamanho da particula
    glScalef(0.2f,0.2f,0.2f);

    // Definindo a cor da particula
    glColor4f(particula->cor[0],particula->cor[1],particula->cor[2],particula->cor[3]);

    // Desenha a particula em si
    desenhaParticula(particula);

    glPopMatrix();
}

// Funcao que ficara atualizando as caracteristcas de cada particula
// Tempo de vida, trajetoria...
void updateParticula(struct Particula *particula){
    /*
    A funcao updateParticula e responsavel por atualizar toda condicao de uma particula
    que esta viva, assim ela decrementa o tempo de vida da mesma analisando o tempo de
    processamento da aplicacao, alem de alterar seu posicionamento atraves da velocidade
    analisando a consistencia da nova posicao para nao atravesar o plano de "chao",
    alem da alteracao da cor dela, respeitando o decaimento pela distancia, alem de
    definir o tamanho final da particula.
    */

    // Decrementa o tempo de vida da particula pelo tempo do ultimo update de frame
    particula->tempoVivido = particula->tempoVivido - tempo_gasto;

    // Calcula movimento
    glPushMatrix();

 //   particula->pos[2] = ((particula->pos[2] - cos(particula->angulo_sentido)) + (rand() % 40)) * tempo_gasto ;
 //   particula->pos[1] = (particula->pos[1] + sin(particula->angulo_sentido)) * tempo_gasto;

    // Definindo movimentacao em x y mas cte
    //particula->pos[0] = particula->pos[0] + 0.05f;
    //particula->pos[1] = particula->pos[1] + 0.05f;

    // Definindo movimentacao em um x, y random
    particula->pos[0] = particula->pos[0] + particula->velocidade[0];
    particula->pos[1] = particula->pos[1] + particula->velocidade[1];

    // Verificacao para nao deixar a particula passar abaixo do solo
    if((particula->pos[2] + particula->velocidade[2]) < 0.0f){
        particula->pos[2] = 0.0f;
    }
    else{
        particula->pos[2] = particula->pos[2] + particula->velocidade[2];
    }


    // Definindo posio da particula
    glTranslatef(particula->pos[0],particula->pos[1],particula->pos[2]);

    // Altera dimensao da particula
    glScalef(0.2f,0.2f,0.2f);

    // Decaimento da opacidade da particula com o tempo
    particula->cor[3] = (particula->tempoVivido) / (particula->tempoDeVida); // Alfa

    // Desenha a particula em si
    desenhaParticula(particula);

    glPopMatrix();
}

// Definicao do sistema de particulas, onde ponto ondele ficara emitindo
void SistemaDeParticulas(struct SistemaParticula *sistema){
    /*
    A funcao SistemaDeParticula e responsavel por atraves de uma referencia a uma fonte de particulas
    analisar todas as particulas desse sistema e ficar analisando seu tempo de vida para se for necessario
    instanciar uma nova caso a particula ja esteja morta ou atualizar seu posicionamento
    */

    // Varre todas as particulas para aplicar as funcoes necessarias
    for (int i = 0; i < nParticulas; i ++){
        // Verifica se a particula ja morreu para recriar-la
        // Particula morreu
        if(sistema->particula[i].tempoVivido <= 0.0){
            instanciaParticula(&sistema->particula[i],sistema->pos[0],sistema->pos[1],sistema->pos[2]);
        }
        // Particula ainda nao morreu mas precisa se mover
        else{
            updateParticula(&sistema->particula[i]);
        }
    }
}

// Definicao e gerenciamento do sistema de fonte de particulas
void CriacaoFonteDeParticulas(struct SistemaParticula *sistema, float xSistPart, float ySistPart, float zSistpart,float tempoDeVidaSist){
    /*
        CriacaoFonteDeParticulas e uma funcao que tem por objetivo
        receber uma referencia para uma posiao de um sistema de particulas
        e colocar as definicoes necessarias nela e chamar a funcao para realmente instanciar
        as particulas nessa fonte

        Recebe como parametros: * A referencia de um sistema, a localizacao em que ela sera posicionada (x,y,z)
        e seu tempo de vida (Obs, tempo de vida do sistema e nao da particula)
    */
    // Definicao da fonte de emissao das particulas
    sistema->pos[0] = xSistPart;
    sistema->pos[1] = ySistPart;
    sistema->pos[2] = zSistpart;

    // Definicao do tempo de vida de geracao de novas particulas daquele sistema
    sistema->tempoDeVidaSistema = tempoDeVidaSist;

    // Criacao de todas as particulas desse sistema
    SistemaDeParticulas(sistema);
}


int GerenciamentoDeInstanciamentoFonteDeParticulas(float xSistPart, float ySistPart, float zSistpart,float tempoDeVidaSist){
    /*
    A funcao GerenciamentoDeInstanciamentoFonteDeParticulas permite
    atualiza a struct de particulas existentes
     atraves da definicao da posicao do sistema e do tempo de vida,
    alocando no vetor de sistema ja existente na melhor posicao, ou substituindo caso
    ja tenha ultrapassado seu limite.

    Retornos: 0 -> Tinha espaco no sistema
              1 -> Sistema lotado e algum sistema substituido
    */

    // Guarda o indice do sistema
    int indexSistemaParticulas = 0;
    float tempoVidaSistemaParticula = 100.0f;

    // Varre todo o vetor de sistema de particulas
    for(int i = 0; i < nSistemaParticulas; i++){

        // Analisa se o sistema de particula para aquela posicao esta "morto"
        // Sistema esta morto
        if((sistema[i].tempoDeVidaSistema) == 0.0f){
            // Cria um sistema nesse indice
            sistema[i].pos[0] = xSistPart;
            sistema[i].pos[1] = ySistPart;
            sistema[i].pos[2] = zSistpart;
            sistema[i].tempoDeVidaSistema = tempoDeVidaSist;
            // "Mata todas as particulas existentes daquele sistema
            for(int j = 0; j < nParticulas; j++){
                sistema[i].particula[j].tempoDeVida = 0.0f;
                sistema[i].particula[j].tempoVivido = 0.0f;
            }
            return 0;
        }
        // Sistema ainda esta vivo
        else{
            if(tempoVidaSistemaParticula > sistema[i].tempoDeVidaSistema){
                // Guarda o indice desse sistema e seu tempo de vida para ver se sera substituido
                indexSistemaParticulas = i;
                tempoVidaSistemaParticula = sistema[i].tempoDeVidaSistema;
            }
        }
    }
    // O vetor de sistema de particula esta lotado se saiu do for
    // Cria o sistema de particula no indice de sistema q tem o menor tempo de vida
            sistema[indexSistemaParticulas].pos[0] = xSistPart;
            sistema[indexSistemaParticulas].pos[1] = ySistPart;
            sistema[indexSistemaParticulas].pos[2] = zSistpart;
            sistema[indexSistemaParticulas].tempoDeVidaSistema = tempoDeVidaSist;

            // "Mata todas as particulas existentes daquele sistema
            for(int j = 0; j < nParticulas; j++){
                sistema[indexSistemaParticulas].particula[j].tempoDeVida = 0.0f;
                sistema[indexSistemaParticulas].particula[j].tempoVivido = 0.0f;
            }
        return 1;
}

void UpdateFonteDeParticula(){
    /*
        UpdateFonteDeParticula e uma funcao que tem por objetivo
        varrer todo o vetor de sistemas disponiveis, caso tenha
        sistemas ativos, reduz seu respectivo tempo de vida e desenha
        naquele frame e caso esteja morto, para de desenhar e arredonda
        seu valor para 0.0
    */
    // Varre todo o vetor de sistema de particulas
    for(int i = 0; i < nSistemaParticulas; i++){
        if(sistema[i].tempoDeVidaSistema > 0.0f){

            // Decrementa o tempo de vida do sistema de emissao de particula pelo tempo do ultimo update de frame
            sistema[i].tempoDeVidaSistema = sistema[i].tempoDeVidaSistema - tempo_gasto;

            // Desenha a fonte para aquele frame
            CriacaoFonteDeParticulas(&sistema[i],sistema[i].pos[0],sistema[i].pos[1],sistema[i].pos[2],sistema[i].tempoDeVidaSistema);
        }
        else{
            sistema[i].tempoDeVidaSistema = 0.0f;
        }
    }
}

