static void key(unsigned char key, int xx, int yy)
{
    switch (key)
    {
        case 27 :
            // Trava todas as teclas do jogo
            if(jogoTravado == 1){
                // Reseta o jogo
                case 'r' :
                    // Retira todos objetos mortos do vetor
                    limpaMortos();
                    // Reinicia as instrues
                    tempoInstrucoes = tempInst;
                    // Recarrega todas as colisoes do mapa
                    carregadasColisoesMapa = 0;
                    // Reinicia o tempo de vida
                    ptosVida = 5;
                    // Reinicia os pontos acertados
                    ptosAcertos = 0;
                    // Reincia a quantidade de tiros
                    qtdTirosRestantes = qtdTiros;
                    // Reincia a posicao do jogador
                    // Posicao
                    x = 0.0f;
                    z = 2.0f;
                    // Angulo
                    angle = 0.0f;
                    // Direcao da camera
                    lx = 0.0f;
                    lz = -1.0f;
                    // Reinicia os flashs
                    qtdFlash = qtdFlashtot;
                break;
            }
            else{
                case 'y' :
                    if(qtdFlash > 0){
                        qtdFlash = qtdFlash - 1;
                        tempoFlash = tempoDeFlash;
                    }
                break;

                case 'k' :
                    // Permite atirar se tiver municao
                //    if(qtdTiros > 0){
                        // Definindo que o lugar que atirou  o lugar de nascimento da bala
                        balaPosIniX = x;
                        balaPosIniY = z;
                        balaPoslxDisp = lx;
                        balaPoslyDisp = lz;

                        atirou = true;
                        if(qtdTirosRestantes > 0){
                            GerenciamentoDeInstanciamentoProjetil(x,z,0,1);
                            qtdTirosRestantes = qtdTirosRestantes - 1;
                        }

                  //      qtdTiros = qtdTiros - 1;
    //                }

            break;

                case 'e' :
                    // Retira todos objetos mortos do vetor
                    limpaMortos();
                    // Reinicia as instrues
                    tempoInstrucoes = tempInst;
                    // Recarrega todas as colisoes do mapa
                    carregadasColisoesMapa = 0;
                    // Reinicia o tempo de vida
                    ptosVida = 5;
                    // Reinicia os pontos acertados
                    ptosAcertos = 0;
                    // Reincia a quantidade de tiros
                    qtdTirosRestantes = qtdTiros;
                    // Reincia a posicao do jogador
                    // Posicao
                    x = 0.0f;
                    z = 2.0f;
                    // Angulo
                    angle = 0.0f;
                    // Direcao da camera
                    lx = 0.0f;
                    lz = -1.0f;
                    // Reinicia os flashs
                    qtdFlash = qtdFlashtot;
                break;

            case 'd' :
                angle -= 0.01f;
                lx = sin(angle);
                lz = -cos(angle);
                break;
            case 'a' :
                angle += 0.01f;
                lx = sin(angle);
                lz = -cos(angle);
                break;
            case 'w' :
                x += lx ;
                z += lz ;

                //if(objetoColidiu(&colisoesMapa[2], x, z)){
                if(comparaTodasColisoes(personagem) != -1){
                    x -= lx ;
                    z -= lz ;
                }

                break;
            case 's' :
                x -= lx;
                z -= lz;

          //      if(comparaTodasColisoes(personagem)){
          //          x += lx;
          //          z += lz;
           //     }
                break;

            case 'p':
               // exit(0);
               tempoInstrucoes = 0.0f;
                break;

            case 'q':
                exit(0);
                break;

            case '+':
                break;

            case 'x':

                break;

            case '-':

                break;
        }
    }

    glutPostRedisplay();
}

